import React from 'react';

const LandingPage = () => {
  return (
    <div className="container mx-auto py-10 text-center">
      <h1 className="text-4xl font-bold mb-6">Welcome to Salon Booking</h1>
      <p className="text-lg">Book your appointments online with ease!</p>
      <a href="/booking" className="inline-block bg-pink-600 text-white py-2 px-4 rounded-lg mt-6">Book Now</a>
    </div>
  );
};

export default LandingPage;
